jupyter.configuration.jupyter.variableQu:
用於查詢 Jupyter 核心中使用中變數清單之查詢對應的語言。由互動視窗和筆記本中的變數總管使用。範例:
```
[
  {
    "language": "python",
    "query": "%who_ls",
    "parseExpr": "'(\\w+)'"
  }
]
```

